const Menu = () =>{

      // Define the menu data for the restaurant
   const restaurantMenu = [
    { name: 'Dish 1', price: '$10', key:"1" },
    { name: 'Dish 2', price: '$12', key:"2"  },
    { name: 'Dish 3', price: '$8' , key:"3" },
    { name: 'Dish 4', price: '$15' , key:"4" },
    { name: 'Dish 5', price: '$9', key:"5"  },
    { name: 'Dish 6', price: '$11' , key:"6" },
    { name: 'Dish 7', price: '$13', key:"7"  },
    { name: 'Dish 8', price: '$14' , key:"8" }
  ];

  return (
    <div className="menu-page">
      <h1>Menu - Restaurant </h1>
      <ul>
        {restaurantMenu.map((dish, index) => (
          <li key={index}>
            <strong>{dish.name}</strong> - <span>{dish.price}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}


export default Menu;
